const EmptyCave = ({ sx, version }) => {
    return <Grid
        sx={sx}
        booleanGrid={stoneGrid}
        trueStyle={{ backgroundColor: colors.stoneGrey }}
        falseStyle={{}}
        height={window.innerHeight * 0.8}
        width={window.innerHeight * 0.8 / (stoneGrid.length / stoneGrid[0].length)}
    />
}

